import React, { Component, Fragment } from 'react'

function Blog() {
  return (
    <Fragment>
        <h1>My Files</h1>
        <p text='Learn React App' />
        <div className='actions'>
            <button className='btn'>Delete</button>
        </div>
    </Fragment>
  )
}

export default Blog;
